import Data from '../../Utils/Data';
const Weather = () => {
    useEffect(() => {
        Data.GetWeather()
            .then(response => {
                  response.length > 0 &&  response?.map((iteam) => {
                        iteam?.map(iteam1 => {
                            var temp = ""
                            const TempDiv = document.getElementsByClassName("temp-div")[0]
                            temp = (iteam1.temp - 273) + '&deg;'
                            lo
                            TempDiv.innerHTML = temp;

                        })
                        iteam?.weather?.map(iteam2 =>{
                            var Deck = ""
                            const TempDesc = document.getElementsByClassName("temp-desc")[0]
                            Deck = iteam2.temp
                            TempDesc.innerHTML = Deck;
                        })

                    })
                }
            )
    }, [])
    return (
        <div>
            <div>
                <h3 className='temp-div'></h3>
                <h5 className='temp-desc'></h5>
            </div>
        </div>
    );
};

export default Weather;
